import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TodoList = () => {
  const [todos, setTodos] = useState([]);
  const [unresolvedTodos, setUnresolvedTodos] = useState([]);
  const [resolvedTodos, setResolvedTodos] = useState([]);

  useEffect(() => {
    axios.get('http://jsonplaceholder.typicode.com/todos')
      .then(response => {
        setTodos(response.data);
        setUnresolvedTodos(response.data.filter(todo => !todo.completed));
        setResolvedTodos(response.data.filter(todo => todo.completed));
      })
      .catch(error => {
        console.error('Error fetching todos:', error);
      });
  }, []);

  return (
    <div>
      <h2>Lista de todos los pendientes</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
            <th>User ID</th>
            <th>Estado</th>
          </tr>
        </thead>
        <tbody>
          {todos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
              <td>{todo.userId}</td>
              <td>{todo.completed ? 'Resuelto' : 'Pendiente'}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Lista de todos los pendientes sin resolver</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {unresolvedTodos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Lista de todos los pendientes resueltos</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {resolvedTodos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TodoList;
